package com.mapbox.navigation.examples.core.camera

import com.mapbox.geojson.Point
import com.mapbox.maps.CameraOptions
import com.mapbox.maps.EdgeInsets
import com.mapbox.navigation.ui.maps.camera.data.ViewportData
import java.util.Calendar
import java.util.GregorianCalendar
import java.util.Scanner

data class CameraRaw(
    val centerLon: Double,
    val centerLat: Double,
    val paddingTop: Double,
    val paddingLeft: Double,
    val paddingBottom: Double,
    val paddingRight: Double,
    val zoom: Double?,
    val bearing: Double?,
    val pitch: Double?,
) {
    fun toCameraOptions() = CameraOptions.Builder()
        .center(Point.fromLngLat(centerLon, centerLat))
        .padding(EdgeInsets(paddingTop, paddingLeft, paddingBottom, paddingRight))
        .zoom(zoom)
        .bearing(bearing)
        .pitch(pitch)
        .build()
}

data class LogEntry(
    val time: Calendar,
    val cameraForFollowing: CameraRaw,
    val cameraForOverview: CameraRaw
) {

    val timeInMillis: Long by lazy {
        time.timeInMillis
    }

    val viewportData: ViewportData by lazy {
        ViewportData(
            cameraForFollowing = cameraForFollowing.toCameraOptions(),
            cameraForOverview = cameraForOverview.toCameraOptions()
        )
    }
}

object TestCameraData {

    fun parseEntries(input: String = rawData): List<LogEntry> {
        val result = mutableListOf<LogEntry>()
        Scanner(input).use {
            while (it.hasNext()) {
                val nextLine = it.nextLine()
                if (nextLine.contains("MapboxNavigationViewportDataSource.evaluate()")) {
                    result.add(parseLogEntry(nextLine))
                }
            }
        }
        return result
    }

    fun parseNeededEntries(input: String = rawData): List<LogEntry> {
        return parseEntries(input).filter { it.time.get(Calendar.MINUTE) > 41 }
    }

    private fun parseCameraRaw(input: String): CameraRaw? {
        val regex = """center: Point\{type=Point, bbox=null, coordinates=\[(.+), (.+)\]\}, padding: \[top: (.+), left: (.+), bottom: (.+), right: (.+)\], anchor: , zoom: (.+), bearing: (.+), pitch: (.+)""".toRegex()
        val cameraMatch = regex.find(input)
        return cameraMatch?.let {
            val (centerLon, centerLat, paddingTop, paddingLeft, paddingBottom, paddingRight, zoom, bearing, pitch) = cameraMatch.destructured
            CameraRaw(
                centerLon = centerLon.toDouble(),
                centerLat = centerLat.toDouble(),
                paddingTop = paddingTop.toDouble(),
                paddingLeft = paddingLeft.toDouble(),
                paddingBottom = paddingBottom.toDouble(),
                paddingRight = paddingRight.toDouble(),
                zoom = zoom.toDouble(),
                bearing = bearing.toDouble(),
                pitch = pitch.toDouble(),
            )
        }
    }

    private fun parseTime(input: String): GregorianCalendar? {
        val regex = """(\d+):(\d+):(\d+)(\d+)""".toRegex()
        val timeMatch = regex.find(input)
        return timeMatch?.let {
            val (h, m, s, ms) = timeMatch.destructured
            GregorianCalendar().apply {
                set(GregorianCalendar.HOUR, h.toInt())
                set(GregorianCalendar.MINUTE, m.toInt())
                set(GregorianCalendar.SECOND, s.toInt())
                set(GregorianCalendar.MILLISECOND, ms.toInt())
            }
        }
    }

    private fun parseLogEntry(input: String): LogEntry {
        val regex = """\d{2}-\d{2} (\d{2}:\d{2}:\d{2}.\d{3}) \d+ \d+ D MapZoomingTest: MapboxNavigationViewportDataSource.evaluate\(\). resulting viewportData: ViewportData\(cameraForFollowing=\[(.+)\]\, cameraForOverview=\[(.+)\]\)""".toRegex()

        val match = regex.find(input)
        return match?.let {
            val (time, cameraForFollowing, cameraForOverview) = match.destructured
            val parsedTime = parseTime(time) ?: throw Exception("Unable to parse time: $time")
            val parsedCameraForFollowing = parseCameraRaw(cameraForFollowing) ?: throw Exception("Unable to parse cameraForFollowing: $cameraForFollowing")
            val parsedCameraForOverview = parseCameraRaw(cameraForOverview) ?: throw Exception("Unable to parse cameraForOverview: $cameraForOverview")
            LogEntry(
                time = parsedTime,
                cameraForFollowing = parsedCameraForFollowing,
                cameraForOverview = parsedCameraForOverview
            )
        } ?: throw Exception("Unable to parse log entry: $input")
    }

